import{_ as e,c as a,o,a4 as r}from"./chunks/framework.CL14adID.js";const b=JSON.parse('{"title":"Carga Materiales a OTs de Mantenimiento","description":"","frontmatter":{},"headers":[],"relativePath":"guide/GP2022.md","filePath":"guide/GP2022.md"}'),i={name:"guide/GP2022.md"},t=r(`<h1 id="carga-materiales-a-ots-de-mantenimiento" tabindex="-1">Carga Materiales a OTs de Mantenimiento <a class="header-anchor" href="#carga-materiales-a-ots-de-mantenimiento" aria-label="Permalink to &quot;Carga Materiales a OTs de Mantenimiento&quot;">​</a></h1><p>Proyecto Digitalización (REPSOL)</p><p>Área Almacén Repuestos</p><p>Lugar: C.I. Tarragona</p><p>Fecha: Enero, 2023 - Julio, 2023</p><h2 id="objetivo-optimizacion-gp2024" tabindex="-1">Objetivo: Optimización GP2024 <a class="header-anchor" href="#objetivo-optimizacion-gp2024" aria-label="Permalink to &quot;Objetivo: Optimización GP2024&quot;">​</a></h2><h2 id="miembros-del-equipo" tabindex="-1">Miembros del equipo <a class="header-anchor" href="#miembros-del-equipo" aria-label="Permalink to &quot;Miembros del equipo&quot;">​</a></h2><table><thead><tr><th>Nombre</th><th>Empresa</th><th>Contacto</th></tr></thead><tbody><tr><td>Carlos Gonzalez</td><td>REPSOL</td><td><a href="mailto:cgonzalezv@repsol.com" target="_blank" rel="noreferrer">cgonzalezv@repsol.com</a></td></tr><tr><td>Ángel A. Urbina</td><td>REPSOL</td><td><a href="mailto:aaurbinas@repsol.com" target="_blank" rel="noreferrer">aaurbinas@repsol.com</a></td></tr><tr><td>Manuel Collado</td><td>ESERMAN</td><td><a href="mailto:manuelcollado@eserman.com" target="_blank" rel="noreferrer">manuelcollado@eserman.com</a></td></tr><tr><td>Antonio Sabate</td><td>ESERMAN</td><td><a href="mailto:antonio.sabate@servexternos.repsol.com" target="_blank" rel="noreferrer">antonio.sabate@servexternos.repsol.com</a></td></tr></tbody></table><hr><p>&quot;Chance favors the connected mind.&quot;</p><p>― Steven Johnson, Where Good Ideas Come from: The Natural History of Innovation</p><p>&quot;There is immense power when a group of people with similar interests gets together to work toward the same goals. Players focus on the wins and the loses. Builders focus on the team and future of the vision. Let’s move from team player to team builder.&quot;</p><p>― Idowu Koyenikan, Wealth for All: Living a Life of Success at the Edge of Your Ability</p><p>En los entornos altamente competitivos y desafiantes de una empresa industrial moderna la exigencia de optimización continua de los procesos es una necesidad básica. Uno de los caminos para conseguir esos objetivos es permitir hacer aflorar el valor oculto que reside en el conocimiento y experiencia de las personas que colaboran en el día a día en las diferentes áreas que componen cada equipo. En nuestro caso el servicios de almacén de repuestos del Centro Industrial de Tarragona de REPSOL.</p><p>El objetivo buscado en este trabajo ha sido la optimización del proceso de gestión de grandes paradas. Hemos de agradecer a todo el personal tanto de REPSOL como de ESERMAN su predisposición y apertura de miras que ha permitido el desarrollo de este proyecto.</p><p>Equipo Almacén</p><p>Centro Industrial REPSOL Tarragona, Julio 2024</p><hr><h2 id="objetivo-del-proyecto" tabindex="-1">Objetivo del proyecto <a class="header-anchor" href="#objetivo-del-proyecto" aria-label="Permalink to &quot;Objetivo del proyecto&quot;">​</a></h2><p>Resumen ejecutivo</p><p>Este proyecto surge de la necesidad de optimizar el proceso de despacho de materiales del almacén cuando existen picos elevados de demanda de materiales. (Principalmente Paradas de Planta)</p><p>Esta necesidad surge por la concurrencia de procesos en el almacén que provocan interferencias en la gestión de materiales y por extensión en el trabajo de los servicios que son usuarios de los mismos durante las paradas.</p><p>Situación durante paradas</p><ul><li>Gran número de materiales recepcionados.</li><li>Gran número de reservas generadas de materiales para ordenes de mantenimiento.</li><li>Alto número de materiales que están siendo preparados para ser retirados en bloques.</li><li>Retirada de bloques de materiales preparados con anterioridad.</li><li>Generación de un alto número de solicitudes de pedido nuevas.</li><li>Necesidad de realizar el proceso de planificación de materiales para mantener el stock de los almacenes.</li></ul><p>La experiencia muestra que es critico que la información disponible sobre la situación de los materiales en el sistema de gestión SAP se correspondan con la real en el menor tiempo posible. La sistemática previa de trabajo provocaba retrasos en la gestión de información y cuellos de botella en los procesos internos del almacén.</p><p>En el marco de este proyecto se analizó el proceso interno de preparación de materiales en el almacén y se han identificado varios puntos de mejora. Como consecuencia se han diseñado y construido varios robots destinados a la automatización y simplificación de las siguientes actividades:</p><p>Robots Construidos</p><ul><li>Generación automática de listados de soporte a la preparación de los materiales</li><li>Automatización proceso carga de consumos a las ordenes de mantenimiento.</li></ul><h2 id="el-trabajo-realizado-es-acorde-la-linea-estrategica-de-digitalizacion-adoptada-por-repsol" tabindex="-1">El trabajo realizado es acorde la línea estratégica de digitalización adoptada por Repsol. <a class="header-anchor" href="#el-trabajo-realizado-es-acorde-la-linea-estrategica-de-digitalizacion-adoptada-por-repsol" aria-label="Permalink to &quot;El trabajo realizado es acorde la línea estratégica de digitalización adoptada por Repsol.&quot;">​</a></h2><h2 id="_0-1-1-objetivo-del-informe" tabindex="-1">0.1.1. Objetivo del informe <a class="header-anchor" href="#_0-1-1-objetivo-del-informe" aria-label="Permalink to &quot;0.1.1. Objetivo del informe&quot;">​</a></h2><p>El objetivo final de este informe es permitir que los resultados obtenidos en este proyecto y las metodologías utilizadas se conozcan y sean transferidas a otras áreas de la compañía que pudieran necesitarlas en un futuro.</p><p>Creemos que la divulgación de las lecciones aprendidas durante el proceso de desarrollo de las soluciones adoptadas facilitará el proceso de implantación de estas mismas soluciones o similares en áreas con problemáticas parecidas a las abordadas.</p><p>Este documento resume el proceso seguido en el desarrollo e implementación de las soluciones implantadas. Describe los desafíos a los que nos hemos enfrentado y cómo los hemos abordado para conseguir la meta final de optimizar el servicio al que pertenecemos.</p><h2 id="_0-2-¿que-se-ha-hecho" tabindex="-1">0.2. ¿Qué se ha hecho? <a class="header-anchor" href="#_0-2-¿que-se-ha-hecho" aria-label="Permalink to &quot;0.2. ¿Qué se ha hecho?&quot;">​</a></h2><p>Basándonos en la experiencia recopilada en paradas previas, se ha constituido un grupo de trabajo para intentar optimizar y resolver los cuellos de botella identificados en la gestión de paradas. Todo ello con la mirada puesta en la mejora del flujo de trabajo del almacén para la prevista GP2024.</p><h3 id="principales-desarrollos-realizados" tabindex="-1">Principales desarrollos realizados <a class="header-anchor" href="#principales-desarrollos-realizados" aria-label="Permalink to &quot;Principales desarrollos realizados&quot;">​</a></h3><p>Generación Listados Materiales para optimizar el trabajo de picking de los materiales. Se generará un listado con la siguiente información:</p><ul><li>Orden: Orden de Trabajo</li><li>Operación: Operación dentro Orden</li><li>Reserva: Reserva del Material</li><li>LineaReserva: Línea de Reserva</li><li>Material: Material reservado</li><li>Texto: Descripción Material</li><li>CantNecesaria: Cantidad Necesaria</li><li>CantTomada: Cantidad Tomada</li><li>Preparar: Cantidad a Preparar</li><li>TIPO ALMACEN: Tipo Almacén</li><li>UBICACION ALMACEN: Ubicación</li><li>STOCKS: Stock</li><li>LOTES: Lote</li><li>CLASE: Clase Valoración</li><li>BLOQUE: Bloque</li><li>GENE/ESPE: Genérico Específico</li><li>PuestoTrabajo: Puesto de trabajo. Ejemplo Formato (TUB)</li><li>CANTIDAD: Cantidad realmente cogida</li><li>DESTINO: Destino de la mercancía</li><li>COLADA: Colada Material / si la hubiera</li></ul><p>Proceso automático de Carga masiva de materiales a Ordenes de Trabajo</p><ul><li>Reducción significativa de los procesos de gestión de materiales durante las paradas.</li><li>Permite actualización rápida de la situación de materiales servidos.</li></ul><hr><h2 id="impactos-generados" tabindex="-1">Impactos generados <a class="header-anchor" href="#impactos-generados" aria-label="Permalink to &quot;Impactos generados&quot;">​</a></h2><p>Algunas estimaciones del impacto obtenido se resumen en la siguiente tabla:</p><p>Benefición Obtenidos</p><ul><li><p>Generación Listados Materiales para optimizar el trabajo de picking de los materiales. En la situación previa el proceso era completamente manual. Teniendo el operador que consultar repetidamente el sistema SAP consultando varias transacciones con el objetivo de identificar, stocks disponibles y ubicaciones de los materiales. Una vez identificado por el operador tenia que proceder a realizar el picking manual. La solución implementada permite:</p></li><li><p>Liberar a los operarios del proceso de consultas manuales en SAP para cada material</p></li><li><p>Disponer de un listado ordenado en formato impreso con la información relevante para el picking automático de materiales</p></li><li><p>Carga masiva de materiales a Ordenes de Trabajo. En la situación previa los operadores tenían que descontar los vales de los materiales a las reservas de forma manual teniendo que consultar varias transacciones SAP. Esto generaba retrasos de semanas desde que el material había sido servido hasta que se descontaba en el sistema. La nueva sistemática permite:</p></li><li><p>Permitir que el responsable de almacén introduzca con facilidad en un formato electrónico la información real de los materiales preparados en el proceso</p></li><li><p>Carga automática en SAP de los materiales a las ordenes de trabajo</p></li><li><p>Entrega dos archivos ejecutables para facilitar el trabajo empresa colaboradora. Las soluciones desarrolladas se entregan para su uso en formato ejecutable en el entorno de trabajo SAP de REPSOL al contratista.</p></li></ul><p>La tecnología utilizada en la solución de estos problemas es fácilmente replicable en otras áreas de la compañía donde este implantado SAP.</p><h2 id="las-soluciones-aportadas-tienen-especial-relevancia-en-procesos-en-que-el-coste-de-desarrollo-de-soluciones-por-empresas-externas-o-el-coste-de-utilizacion-de-licencias-de-programas-comercializados-hagan-inviable-las-soluciones-estandares-propuestas-por-la-compania" tabindex="-1">Las soluciones aportadas tienen especial relevancia en procesos en que el coste de desarrollo de soluciones por empresas externas o el coste de utilización de licencias de programas comercializados hagan inviable las soluciones estándares propuestas por la compañía. <a class="header-anchor" href="#las-soluciones-aportadas-tienen-especial-relevancia-en-procesos-en-que-el-coste-de-desarrollo-de-soluciones-por-empresas-externas-o-el-coste-de-utilizacion-de-licencias-de-programas-comercializados-hagan-inviable-las-soluciones-estandares-propuestas-por-la-compania" aria-label="Permalink to &quot;Las soluciones aportadas tienen especial relevancia en procesos en que el coste de desarrollo de soluciones por empresas externas o el coste de utilización de licencias de programas comercializados hagan inviable las soluciones estándares propuestas por la compañía.&quot;">​</a></h2><h2 id="sobre-el-proyecto" tabindex="-1">Sobre el proyecto <a class="header-anchor" href="#sobre-el-proyecto" aria-label="Permalink to &quot;Sobre el proyecto&quot;">​</a></h2><p>Este proyecto surge de la necesidad de optimizar el proceso de despacho de materiales del almacén cuando existen picos elevados de demanda de materiales. (Principalmente Paradas de Planta) En esas situaciones nos encontramos que es crítico que la información disponible de los materiales en el sistema de gestión SAP se corresponda con la realidad.</p><p>A continuación se resumen los cambios más significativos realizados a lo largo del proyecto.</p><p>El proyecto completo se encuentra documentado en: Link</p><h3 id="_0-4-control-de-versiones" tabindex="-1">0.4. Control de versiones <a class="header-anchor" href="#_0-4-control-de-versiones" aria-label="Permalink to &quot;0.4. Control de versiones&quot;">​</a></h3><p>Modificaciones más importantes del proyecto.</p><table><thead><tr><th>Versión</th><th>Notable changes</th></tr></thead><tbody><tr><td>0.1</td><td>• Primera versión del documento</td></tr><tr><td></td><td>• Diseño inicial del documento</td></tr><tr><td>0.2</td><td>• Diseño contenidos</td></tr><tr><td>1.0</td><td>• Primera versión documento</td></tr><tr><td>1.1</td><td>• Revisión tras pruebas operativas</td></tr></tbody></table><hr><h1 id="preface" tabindex="-1">Preface <a class="header-anchor" href="#preface" aria-label="Permalink to &quot;Preface&quot;">​</a></h1><p>Contenidos i</p><h1 id="resumen-ejecutivo" tabindex="-1">Resumen ejecutivo <a class="header-anchor" href="#resumen-ejecutivo" aria-label="Permalink to &quot;Resumen ejecutivo&quot;">​</a></h1><table><thead><tr><th>Resumen</th><th>ii</th></tr></thead><tbody><tr><td>0.1 Objetivo del proyecto</td><td>ii</td></tr><tr><td>0.1.1 Objetivo del informe</td><td>iii</td></tr><tr><td>0.2 ¿Que se ha hecho?</td><td>iii</td></tr><tr><td>0.3 Impactos generados</td><td>iv</td></tr></tbody></table><h1 id="sobre-el-proyecto-1" tabindex="-1">Sobre el proyecto <a class="header-anchor" href="#sobre-el-proyecto-1" aria-label="Permalink to &quot;Sobre el proyecto&quot;">​</a></h1><p>0.4 Control de versiones v</p><h1 id="listado-de-graficos" tabindex="-1">Listado de gráficos <a class="header-anchor" href="#listado-de-graficos" aria-label="Permalink to &quot;Listado de gráficos&quot;">​</a></h1><p>Listado de tablas viii</p><h1 id="introduccion" tabindex="-1">Introducción <a class="header-anchor" href="#introduccion" aria-label="Permalink to &quot;Introducción&quot;">​</a></h1><table><thead><tr><th>1.1 Objetivo</th><th>1</th></tr></thead><tbody><tr><td>1.2 Proceso seguido</td><td>1</td></tr><tr><td>1.2.1 ¿Que nos ha motivado a generar esta sistemática?</td><td>1</td></tr><tr><td>1.2.2 Estudio de alternativas</td><td>1</td></tr><tr><td>1.2.3 Análisis enfoque autoservicio</td><td>2</td></tr><tr><td>1.2.4 Solución propuesta</td><td>3</td></tr></tbody></table><h1 id="propuesta" tabindex="-1">Propuesta <a class="header-anchor" href="#propuesta" aria-label="Permalink to &quot;Propuesta&quot;">​</a></h1><table><thead><tr><th>2.1 Solución Implantada</th><th>4</th></tr></thead><tbody><tr><td>2.1.1 Consideraciones a tener en cuenta para todas las soluciones</td><td>5</td></tr><tr><td>2.2 Generación de listados de trabajo</td><td>6</td></tr><tr><td>2.2.1 Entrada a programa</td><td>6</td></tr><tr><td>2.2.2 Salida del programa</td><td>7</td></tr><tr><td>2.3 Carga de materiales preparados a las ordenes de mantenimiento</td><td>8</td></tr><tr><td>2.3.1 Entrada</td><td>8</td></tr><tr><td>2.3.2 Salida</td><td>8</td></tr></tbody></table><h1 id="generacion-listados-de-trabajo" tabindex="-1">Generación listados de trabajo <a class="header-anchor" href="#generacion-listados-de-trabajo" aria-label="Permalink to &quot;Generación listados de trabajo&quot;">​</a></h1><table><thead><tr><th>3.1 Detalle de Pasos- (PDD)</th><th>11</th></tr></thead><tbody><tr><td>3.2 Código Programa</td><td>11</td></tr></tbody></table><h1 id="carga-materiales-a-ots" tabindex="-1">Carga Materiales a OTs <a class="header-anchor" href="#carga-materiales-a-ots" aria-label="Permalink to &quot;Carga Materiales a OTs&quot;">​</a></h1><table><thead><tr><th>4.1 Detalle de Pasos- (PDD)</th><th>12</th></tr></thead><tbody><tr><td>4.2 Código Programa</td><td>12</td></tr></tbody></table><h1 id="references" tabindex="-1">References <a class="header-anchor" href="#references" aria-label="Permalink to &quot;References&quot;">​</a></h1><p>Recursos Utilizados 13</p><h1 id="a-recursos-utilizados" tabindex="-1">A Recursos Utilizados <a class="header-anchor" href="#a-recursos-utilizados" aria-label="Permalink to &quot;A Recursos Utilizados&quot;">​</a></h1><p>A.1 Recursos Auxiliares Utilizados 13</p><h1 id="b-codigos-fuente" tabindex="-1">B Códigos Fuente <a class="header-anchor" href="#b-codigos-fuente" aria-label="Permalink to &quot;B Códigos Fuente&quot;">​</a></h1><p>B.1 Código Programas generados para resolver el problema 14</p><h1 id="c-control-de-versiones" tabindex="-1">C Control de versiones <a class="header-anchor" href="#c-control-de-versiones" aria-label="Permalink to &quot;C Control de versiones&quot;">​</a></h1><h2 id="control-de-versiones15" tabindex="-1">Control de versiones 15 <a class="header-anchor" href="#control-de-versiones15" aria-label="Permalink to &quot;Control de versiones
15&quot;">​</a></h2><table><thead><tr><th>Listado de gráficos</th><th>1.1 Aplicabilidad tecnología RPA</th><th>2</th></tr></thead><tbody><tr><td></td><td>2.1 Esquema conceptual</td><td>10</td></tr></tbody></table><hr><table><thead><tr><th>Listado de tablas</th><th>3</th></tr></thead><tbody><tr><td>Soluciones Compañia</td><td>3</td></tr><tr><td>Comparativa alternativas</td><td>3</td></tr><tr><td>Esquema Conceptual proceso</td><td>9</td></tr><tr><td>Control de versiones</td><td>15</td></tr></tbody></table><hr><h2 id="objetivo" tabindex="-1">Objetivo <a class="header-anchor" href="#objetivo" aria-label="Permalink to &quot;Objetivo&quot;">​</a></h2><p>El objetivo del presente informe es documentar de forma detallada el proceso seguido para la optimización del proceso de preparación y carga en Ordenes de Trabajo de Mantenimiento de los Materiales reservados para paradas. Se ha diseñado el proceso para que sea escalable y repetible en los diversos centros Industriales de Repsol que utilizan el sistema de gestión SAP. Es nuestra intención poder servir de inspiración a otras organizaciones dentro de la compañía para poder repetir un sistema similar de trabajo en sus instalaciones.</p><h2 id="proceso-seguido" tabindex="-1">Proceso seguido <a class="header-anchor" href="#proceso-seguido" aria-label="Permalink to &quot;Proceso seguido&quot;">​</a></h2><h3 id="¿que-nos-ha-motivado-a-generar-esta-sistematica" tabindex="-1">¿Que nos ha motivado a generar esta sistemática? <a class="header-anchor" href="#¿que-nos-ha-motivado-a-generar-esta-sistematica" aria-label="Permalink to &quot;¿Que nos ha motivado a generar esta sistemática?&quot;">​</a></h3><p>Los factores que originaron este proyecto.</p><h4 id="factores-desencadenantes-proyecto" tabindex="-1">Factores desencadenantes proyecto <a class="header-anchor" href="#factores-desencadenantes-proyecto" aria-label="Permalink to &quot;Factores desencadenantes proyecto&quot;">​</a></h4><p>Necesidad de preparar un elevado numero de materiales reservados en múltiples ordenes de Trabajo para diferentes contratistas y en plazos concretos. Necesidad de disponer en todo momento de la información real de situación de los diferentes materiales necesarios. Necesidad de simplificar el trabajo necesario para la preparación física de los materiales.</p><h3 id="estudio-de-alternativas" tabindex="-1">Estudio de alternativas <a class="header-anchor" href="#estudio-de-alternativas" aria-label="Permalink to &quot;Estudio de alternativas&quot;">​</a></h3><h2 id="lo-primero-que-se-hizo-fue-contactar-con-los-responsables-del-area-de-erp-del-digital-hub-de-repsol-se-identifico-que-inicialmente-estas-iniciativas-de-robotizacion-estaban-basadas-en-la-contratacion-de-consultoras-externas-para-su-realizacion-accenture-etc-estas-empresas-aprovechaban-la-experiencia-que-disponian-en-otras-companias-para-generar-las-aplicaciones" tabindex="-1">Lo primero que se hizo fue contactar con los responsables del área de ERP del digital HUB de REPSOL. Se identificó que inicialmente estas iniciativas de robotización estaban basadas en la contratación de consultoras externas para su realización (Accenture, etc.). Estas empresas aprovechaban la experiencia que disponían en otras compañías para generar las aplicaciones. <a class="header-anchor" href="#lo-primero-que-se-hizo-fue-contactar-con-los-responsables-del-area-de-erp-del-digital-hub-de-repsol-se-identifico-que-inicialmente-estas-iniciativas-de-robotizacion-estaban-basadas-en-la-contratacion-de-consultoras-externas-para-su-realizacion-accenture-etc-estas-empresas-aprovechaban-la-experiencia-que-disponian-en-otras-companias-para-generar-las-aplicaciones" aria-label="Permalink to &quot;Lo primero que se hizo fue contactar con los responsables del área de ERP del digital HUB de REPSOL. Se identificó que inicialmente estas iniciativas de robotización estaban basadas en la contratación de consultoras externas para su realización (Accenture, etc.). Estas empresas aprovechaban la experiencia que disponían en otras compañías para generar las aplicaciones.&quot;">​</a></h2><h2 id="proceso-seguido-1" tabindex="-1">Proceso seguido <a class="header-anchor" href="#proceso-seguido-1" aria-label="Permalink to &quot;Proceso seguido&quot;">​</a></h2><p>¿Qué condiciones debe cumplir un proceso para ser robotizado?</p><p>Se trata de una tarea repetitiva basada en reglas con datos estructurados y frecuentes picos de trabajo.</p><p>Figura 1.1: Aplicabilidad tecnología RPA</p><p>Este hecho comportaba que los costes fueran bastante elevados dejando fuera del alcance de esta tecnología los procesos internos cuyos umbrales de rentabilidad no llegaban al mínimo económico definido.</p><p>Para evitar ese inconveniente la compañía en un segundo paso decidió apostar por que las iniciativas de robotización fueran lideradas por los propios empleados facilitando REPSOL las herramientas de desarrollo. Siendo los propios empleados beneficiarios de las posibles mejoras los que deberían liderar con su iniciativa los proyectos y además deberían hacerse responsables de dar soporte y uso a las soluciones desarrolladas.</p><p>Se pensaba que procediendo de esta forma se aceleraría el proceso de implantación de este tipo de soluciones en sitios todavía no identificados y simultáneamente los costes de implantación y mantenimiento serían bastante inferiores a los seguidos con las primeras implantaciones.</p><p>Es por ello que la compañía puso a disposición de los empleados dos herramientas, una disponible dentro del paquete office 365 de Microsoft (POWER AUTOMATE) destinada a la automatización de procesos que implicaran a las herramientas de Microsoft y otra más sofisticada (DO IT YOURSELF) que como ventaja principal permitía la interacción entre múltiples entornos como en nuestro caso SAP, etc.</p><h2 id="analisis-enfoque-autoservicio" tabindex="-1">Análisis enfoque autoservicio <a class="header-anchor" href="#analisis-enfoque-autoservicio" aria-label="Permalink to &quot;Análisis enfoque autoservicio&quot;">​</a></h2><h2 id="las-dos-herramientas-propuestas-por-la-compania-presentan-las-siguientes-ventajas-e-inconvenientes-se-resumen-en-la-tabla-1-1" tabindex="-1">Las dos herramientas propuestas por la compañía presentan las siguientes ventajas e inconvenientes. Se resumen en la Tabla 1.1 <a class="header-anchor" href="#las-dos-herramientas-propuestas-por-la-compania-presentan-las-siguientes-ventajas-e-inconvenientes-se-resumen-en-la-tabla-1-1" aria-label="Permalink to &quot;Las dos herramientas propuestas por la compañía presentan las siguientes ventajas e inconvenientes. Se resumen en la Tabla 1.1&quot;">​</a></h2><h2 id="proceso-seguido-2" tabindex="-1">Proceso seguido <a class="header-anchor" href="#proceso-seguido-2" aria-label="Permalink to &quot;Proceso seguido&quot;">​</a></h2><table><thead><tr><th>Capacidad</th><th>Solo productos Windows</th><th>Posible usarlo con SAP</th></tr></thead><tbody><tr><td>Coste usuario final</td><td>Licencia incluida</td><td>&gt;5000 euros/año-usuario</td></tr><tr><td>Mantenimiento</td><td>Sin soporte</td><td>Sin soporte</td></tr><tr><td>Aprendizaje</td><td>Autoformacion</td><td>Autoformacion</td></tr><tr><td>Facilidad uso</td><td>Sencillo</td><td>Medio</td></tr></tbody></table><p>El problema planteado en nuestro proceso implicaba la necesidad de que la herramienta tenía que ser utilizada en SAP. Simultáneamente el coste de la solución para SAP impedía su uso inmediato debido a que el ahorro de costes estimado no justificaba el elevado coste anual de licencia necesario para su uso.</p><h3 id="solucion-propuesta" tabindex="-1">Solución propuesta <a class="header-anchor" href="#solucion-propuesta" aria-label="Permalink to &quot;Solución propuesta&quot;">​</a></h3><p>Puesto que las soluciones estándares propuestas por la compañía no satisfacían de forma correcta nuestras necesidades se inició una búsqueda sistemática de posibles soluciones alternativas que implicaran los dos aspectos necesarios.</p><p>Requerimientos necesarios:</p><ul><li>Coste reducido</li><li>Capacidad de utilización con SAP</li></ul><p>Realizando una búsqueda de diferentes soluciones de fuentes abiertas se identificó que las herramientas de software abierto presentaban un gran potencial no explorado.</p><table><thead><tr><th></th><th>POWER AUTOMATE</th><th>DO IT YOURSELF</th><th>PYTHON</th></tr></thead><tbody><tr><td>SAP</td><td>NO</td><td>SI</td><td>SI</td></tr><tr><td>TIPO LIC.</td><td>PROPIETARIO</td><td>PROPIETARIO</td><td>LIBRE</td></tr><tr><td>LICENCIA</td><td>INCLUIDA</td><td>5000 euros/año-usuario</td><td>GRATIS</td></tr><tr><td>SOPORTE</td><td>USUARIO</td><td>USUARIO</td><td>USUARIO</td></tr><tr><td>COMPLEJIDAD</td><td>BAJO</td><td>MEDIO</td><td>ALTO</td></tr><tr><td>USO</td><td>Sencillo</td><td>Medio</td><td>Medio</td></tr></tbody></table><p>Se contactó con expertos de SAP y personas en la organización de sistemas que hubieran tenido experiencia en RPA identificándose que ya había habido enfoques en el pasado utilizando herramientas propietarias tales como visualbasic que habían dado muy buenos resultados.</p><h2 id="basandonos-en-esas-experiencias-previas-se-decide-utilizar-herramientas-mas-modernas-siguiendo-el-enfoque-anterior-por-tanto-se-utilizara-python-en-un-entorno-anaconda-esta-solucion-esta-acorde-con-la-politica-corporativa-de-formar-al-personal-en-esta-herramienta-el-analisis-se-condensa-en-la-tabla-1-2" tabindex="-1">Basándonos en esas experiencias previas se decide utilizar herramientas más modernas siguiendo el enfoque anterior. Por tanto se utilizará Python en un entorno Anaconda. Esta solución está acorde con la política corporativa de formar al personal en esta herramienta. El análisis se condensa en la tabla 1.2. <a class="header-anchor" href="#basandonos-en-esas-experiencias-previas-se-decide-utilizar-herramientas-mas-modernas-siguiendo-el-enfoque-anterior-por-tanto-se-utilizara-python-en-un-entorno-anaconda-esta-solucion-esta-acorde-con-la-politica-corporativa-de-formar-al-personal-en-esta-herramienta-el-analisis-se-condensa-en-la-tabla-1-2" aria-label="Permalink to &quot;Basándonos en esas experiencias previas se decide utilizar herramientas más modernas siguiendo el enfoque anterior. Por tanto se utilizará Python en un entorno Anaconda. Esta solución está acorde con la política corporativa de formar al personal en esta herramienta. El análisis se condensa en la tabla 1.2.&quot;">​</a></h2><h2 id="_2-1-solucion-implantada" tabindex="-1">2.1. Solución Implantada <a class="header-anchor" href="#_2-1-solucion-implantada" aria-label="Permalink to &quot;2.1. Solución Implantada&quot;">​</a></h2><p>Propuesta 2 Una vez analizada las opciones técnicas disponibles se decide abordar el problema mediante el uso del scripts Python en un entorno Anaconda.</p><p>El enfoque adoptado se basará en la subdivisión del proceso global de carga de materiales a las ordenes de trabajo de mantenimiento en dos pasos. Esto permite abordar el problemas de una forma más óptima. Los pasos desarrollados son:</p><ul><li>Generación de listados para simplificar trabajo del personal encargado de realizar los pickings de materiales.</li><li>Proceso de carga de materiales preparados a las ordenes de mantenimiento.</li></ul><p>Para el desarrollo de cada uno de estos pasos se ha trabajado de la siguiente manera:</p><ul><li>Conceptualización de las necesidades desde el punto vista usuario.</li><li>Desarrollo de programa Python sobre SAP en el entorno de pruebas.</li><li>Validación de la ejecución en el entorno pruebas SAP.</li><li>Validación y verificación por usuarios finales del aplicativo desarrollado.</li><li>Test de pruebas en el entorno productivo.</li><li>Construcción ejecutables de los programas.</li><li>Pase a producción.</li></ul><hr><h2 id="_2-1-solucion-implantada-1" tabindex="-1">2.1. Solución Implantada <a class="header-anchor" href="#_2-1-solucion-implantada-1" aria-label="Permalink to &quot;2.1. Solución Implantada&quot;">​</a></h2><p>2.1.1. Consideraciones a tener en cuenta para todas las soluciones</p><p>Los programas se desarrollaron en un entorno Anaconda en Python. En un segundo paso se compilaron para permitir ejecución en cualquier ordenador.</p><p>Requerimientos técnicos entorno producción • Maquina Windows sistema SAP instalado. Este sistema debera tener activado el entorno de ejecución de script del SAP GUI. • El usuario que ejecute el programa debera tener cuenta SAP activa con permisos de ejecución de las transacciones necesarias para la carga de materiales en las ordenes de trabajo. • Antes de ejecutar el script se debera haber activado la pantalla principal del SAP GUI. • No es necesario tener instalado Pypon en la maquina desde donde se va a ejecutar los scripts.</p><p>Estos requerimientos se basan en que los programas desarrollados en python habrán sido previamente compilados en un ejecutable para simplificar el trabajo. Así el usuario final dispondrá solo de unos ejecutables y archivos auxiliares que deberá copiar en su ordenador.</p><h2 id="los-programas-tienen-unos-requerimientos-para-su-funcionamiento-que-se-describen-en-los-siguientes-apartados" tabindex="-1">Los programas tienen unos requerimientos para su funcionamiento que se describen en los siguientes apartados: <a class="header-anchor" href="#los-programas-tienen-unos-requerimientos-para-su-funcionamiento-que-se-describen-en-los-siguientes-apartados" aria-label="Permalink to &quot;Los programas tienen unos requerimientos para su funcionamiento que se describen en los siguientes apartados:&quot;">​</a></h2><h2 id="generacion-de-listados-de-trabajo" tabindex="-1">Generación de listados de trabajo <a class="header-anchor" href="#generacion-de-listados-de-trabajo" aria-label="Permalink to &quot;Generación de listados de trabajo&quot;">​</a></h2><p>El programa esta diseñado para simplificar el trabajo de picking masivo de materiales mediante la generación de un archivo excel con la información necesaria para simplificar la operativa de picking manual.</p><h3 id="entrada-a-programa" tabindex="-1">Entrada a programa <a class="header-anchor" href="#entrada-a-programa" aria-label="Permalink to &quot;Entrada a programa&quot;">​</a></h3><p>El primer paso es la generación de un documento que define la tanda de materiales a preparar por parte del personal de REPSOL.</p><p>El listado de materiales sobre los que se va a realizar el picking estará definido en un archivo Excel que sera la única entrada al proceso.</p><h4 id="datos-de-entrada" tabindex="-1">Datos de Entrada <a class="header-anchor" href="#datos-de-entrada" aria-label="Permalink to &quot;Datos de Entrada&quot;">​</a></h4><p>Especificaciones</p><ul><li>Directorio: Se selecciona en la aplicación</li><li>Archivo: ”RESERVAS.xlsx” proporcionado por REPSOL.</li></ul><p>NOTA: El nombre del archivo proporcionado puede variar. Contendra:</p><ul><li>Código: Código Material. Ejemplo de Formato (80021249)</li><li>Descripción: Descripción Material</li><li>OT: Numero Orden Trabajo</li><li>Operación: Numero Operación</li><li>Reserva: Numero de reserva</li><li>Posición reserva: Posición de la reserva. Ejemplo de formato (14)</li><li>Cantidad dif: Cantidad de Material a Preparar</li><li>UM: Unidad de medida</li><li>Status línea: Status de la linea. ejemplo formato (MACO)</li><li>Bloque: Bloque. ejemplo formato (B1)</li><li>Genérico/específico: Genérico / Especifico. ejemplo formato (G)</li><li>PstoTbjo: Puesto tipo. Ejemplo (TUB)</li><li>SumaDeCantidad dif: Cantidad de Material a Preparar</li><li>Clase: Clase de OT (correctivo, etc..)</li><li>Área: Area de planta (POL)</li><li>Especialidad: Especialidad Mantenimiento (ESTA,...)</li><li>Ubic técnica: Ubicación técnica (T-4-POL-22,..)</li><li>Equipo: Equipo sobre el que se trabaja</li><li>Descripción equipo: Descripción en texto del equipo sobre el que se trabaja</li></ul><p>La información anterior alimentara el programa de generación de datos de picking.</p><p>Cada vez que sea necesario preparar una nueva tanta de materiales se ejecutara el programa.</p><p>En ese proceso el programa comprobara el stock actual de materiales, ubicaciones disponibles y demás información necesaria para el picking. Se generará un archivo excel con el resumen de la información que necesita el operador para poder realizar su trabajo sobre los materiales de la tanta de forma óptima.</p><h2 id="a-medida-que-se-va-desarrollando-el-proceso-manual-de-picking-el-operador-debera-incluir-la-informacion-de-lo-realizado-en-la-columna-correspondiente-del-archivo-generado-en-el-proceso" tabindex="-1">A medida que se va desarrollando el proceso manual de picking el operador deberá incluir la información de lo realizado en la columna correspondiente del archivo generado en el proceso. <a class="header-anchor" href="#a-medida-que-se-va-desarrollando-el-proceso-manual-de-picking-el-operador-debera-incluir-la-informacion-de-lo-realizado-en-la-columna-correspondiente-del-archivo-generado-en-el-proceso" aria-label="Permalink to &quot;A medida que se va desarrollando el proceso manual de picking el operador deberá incluir la información de lo realizado en la columna correspondiente del archivo generado en el proceso.&quot;">​</a></h2><h2 id="generacion-de-listados-de-trabajo-1" tabindex="-1">Generación de listados de trabajo <a class="header-anchor" href="#generacion-de-listados-de-trabajo-1" aria-label="Permalink to &quot;Generación de listados de trabajo&quot;">​</a></h2><p>CANTIDAD: Cantidad real de material cogido</p><p>DESTINO: Ubicación donde se va a dejar el material</p><p>COLADA: Datos que puedan identificar la colada del material si fuera necesario.</p><p>Esto permitirá disponer de un archivo adecuado para la carga en excel efectiva en SAP de los materiales cogidos.</p><h2 id="salida-del-programa" tabindex="-1">Salida del programa <a class="header-anchor" href="#salida-del-programa" aria-label="Permalink to &quot;Salida del programa&quot;">​</a></h2><p>La salida generada en este paso será un excel que contendrá toda la información relevante para el proceso de picking para el operario.</p><h3 id="requerimientos-tecnicos" tabindex="-1">Requerimientos técnicos <a class="header-anchor" href="#requerimientos-tecnicos" aria-label="Permalink to &quot;Requerimientos técnicos&quot;">​</a></h3><p>Se generará un archivo con la información necesaria para el picking.</p><ul><li>Directorio: /</li><li>Archivo: &quot;DD-MM-YYYY-HH-MM-SS_PREPARAR.xlsx&quot; Archivo resultado</li></ul><p>NOTA: La información disponible en PREPARAR.xlsx será:</p><table><thead><tr><th>Orden</th><th>Operación</th><th>Reserva</th><th>Línea de Reserva</th><th>Material reservado</th><th>Descripción Material</th></tr></thead><tbody><tr><td>Cantidad a Preparar</td><td>Cantidad a Preparar Global en un Bloque</td><td>Cantidad a Preparar</td><td>UM, Unidad de Medida</td><td>Tipo Almacén</td><td>Ubicación Almacén</td></tr><tr><td>Stock</td><td>Lote</td><td>Clase Valoración</td><td>Bloque</td><td>Genérico Específico</td><td>Puesto de trabajo. Ejemplo Formato (TUB)</td></tr><tr><td>Clase de OT (correctivo, etc..)</td><td>Area de planta (POL)</td><td>Especialidad Mantenimiento (ESTA,...)</td><td>Ubicación técnica (T-4-POL-22,..)</td><td>Equipo sobre el que se trabaja</td><td>Descripción en texto del equipo sobre el que se trabaja</td></tr><tr><td>Cantidad realmente cogida</td><td>Destino de la mercancía</td><td>Información para identificar la colada Material / si la hubiera</td><td></td><td></td><td></td></tr></tbody></table><hr><h2 id="_2-3-carga-de-materiales-preparados-a-las-ordenes-de-mantenimiento" tabindex="-1">2.3. Carga de materiales preparados a las ordenes de mantenimiento. <a class="header-anchor" href="#_2-3-carga-de-materiales-preparados-a-las-ordenes-de-mantenimiento" aria-label="Permalink to &quot;2.3. Carga de materiales preparados a las ordenes de mantenimiento.&quot;">​</a></h2><p>Una vez preparados los materiales a partir de la información del archivo ’PREPARAR.xlsx’. Se van completando los campos:</p><ul><li>CANTIDAD: Cantidad de material realmente cogida</li><li>DESTINO: Ubicación donde se dejaran preparados los materiales</li><li>COLADA: Información sobre la colada del material si la hubiera.</li></ul><p>Una vez rellena esa información en el archivo correspondiente se procederá a utilizar dicho archivo como entrada al programa que realiza las entradas de materiales en el sistema.</p><p>Se ejecuta el programa ejecutable.</p><h3 id="_2-3-1-entrada" tabindex="-1">2.3.1. Entrada <a class="header-anchor" href="#_2-3-1-entrada" aria-label="Permalink to &quot;2.3.1. Entrada&quot;">​</a></h3><p>Requerimientos técnicos</p><ul><li>Directorio: Se escoge en la aplicación</li><li>Archivo: ”DD-MM-YYYY-HH-MM-SS_PREPARAR.xlsx” Rellenado por el operador</li></ul><h3 id="_2-3-2-salida" tabindex="-1">2.3.2. Salida <a class="header-anchor" href="#_2-3-2-salida" aria-label="Permalink to &quot;2.3.2. Salida&quot;">​</a></h3><h2 id="la-ejecucion-del-programa-producira-el-siguiente-resultado" tabindex="-1">La ejecución del programa producirá el siguiente resultado <a class="header-anchor" href="#la-ejecucion-del-programa-producira-el-siguiente-resultado" aria-label="Permalink to &quot;La ejecución del programa producirá el siguiente resultado&quot;">​</a></h2><h2 id="carga-de-materiales-preparados-a-las-ordenes-de-mantenimiento" tabindex="-1">Carga de materiales preparados a las ordenes de mantenimiento <a class="header-anchor" href="#carga-de-materiales-preparados-a-las-ordenes-de-mantenimiento" aria-label="Permalink to &quot;Carga de materiales preparados a las ordenes de mantenimiento&quot;">​</a></h2><p>Requerimientos técnicos:</p><ul><li>Directorio: /CARGAMATERIALES</li><li>Archivo: InformeEjecuccion.xlsx (Salidas). Información de la ejecución del programa</li><li>&#39;Orden&#39; - Orden de trabajo</li><li>&#39;Operacion&#39; - Operación</li><li>&#39;Reserva&#39; - Reserva del Material</li><li>&#39;LineaReser&#39; - Linea de Reserva</li><li>&#39;Material&#39; - Material reservado</li><li>&#39;Texto&#39; - Descripción Material</li><li>Preparar - Cantidad a Preparar</li><li>PrepararAgruBloque - Cantida a Preparar Global en un Bloque</li><li>UM - UM , Unidad de medida</li><li>TIPO ALMACEN - Tipo Almacen</li><li>UBICACION ALMACEN - Ubicacion</li><li>STOCKS - Stock</li><li>LOTES - Lote</li><li>CLASE - Clase Valoración</li><li>BLOQUE - Bloque</li><li>GENE/ESPE - Genérico Especifico</li><li>&#39;PuestoTrabajo&#39; - Tipo de puesto de trabajo</li><li>ClaseManto - Clase de OT (correctivo, etc..)</li><li>Area - Área de planta (POL)</li><li>Especialidad - Especialidad Mantenimiento (ESTA,...)</li><li>UbicaTecnica - Ubicación técnica (T-4-POL-22,..)</li><li>Equipo - Equipo sobre el que se trabaja</li><li>TextoEquipo - Descripción en texto del equipo sobre el que se trabaja</li><li>CANTIDAD - Cantidad realmente cogida</li><li>DESTINO - Destino de la mercancia</li><li>COLADA - Colada Material / si la hubiera</li><li>Archivo: MAXIMO.log Logs con información de la situación de carga de materiales.</li></ul><h2 id="estructura-de-funcionamiento" tabindex="-1">Estructura de funcionamiento <a class="header-anchor" href="#estructura-de-funcionamiento" aria-label="Permalink to &quot;Estructura de funcionamiento&quot;">​</a></h2><p>Esquema conceptual</p><table><thead><tr><th>Creación Archivo</th><th>Paso Archivo</th></tr></thead><tbody><tr><td>Programa: GeneDocumentov5.py</td><td>GEjecutablev5.py</td></tr><tr><td>Entrada: ENTRADAS.xlsx</td><td>PREPARADO.xlsx</td></tr><tr><td>Salida: FECHA_PREPARAR.xlsx</td><td>FECHA_SALIDA.xlsx</td></tr></tbody></table><hr><h2 id="_2-3-carga-de-materiales-preparados-a-las-ordenes-de-mantenimiento-1" tabindex="-1">2.3. Carga de materiales preparados a las ordenes de mantenimiento. <a class="header-anchor" href="#_2-3-carga-de-materiales-preparados-a-las-ordenes-de-mantenimiento-1" aria-label="Permalink to &quot;2.3. Carga de materiales preparados a las ordenes de mantenimiento.&quot;">​</a></h2><p>InicIO MATERIALES A PREPARAR ESTRADAS.xlsx GeneDocumentov4 DD-MM-YYYY-HH-MM-SS_PREPARAR.xlsx PICKKING GEjecutablev- DD-MM-YYYY-HH-MM-SS_SALIDA.xlsx</p><h2 id="figure-2-1-esquema-conceptual" tabindex="-1">Figure 2.1: Esquema conceptual <a class="header-anchor" href="#figure-2-1-esquema-conceptual" aria-label="Permalink to &quot;Figure 2.1: Esquema conceptual&quot;">​</a></h2><h3 id="generacion-listados-de-trabajo-1" tabindex="-1">Generación listados de trabajo <a class="header-anchor" href="#generacion-listados-de-trabajo-1" aria-label="Permalink to &quot;Generación listados de trabajo&quot;">​</a></h3><p>3.1. Detalle de Pasos- (PDD)</p><p>Los pasos principales son:</p><ul><li>REPSOL proporciona archivo con la identificación de reservas sobre las que habrá que trabajar.</li><li>ESERMAN identifica los materiales sobre los que desea realizar el picking de los listados de materiales proporcionados por REPSOL previamente.</li><li>Se ejecuta el programa GeneDocumentoEXEv5 para obtener el documento para trabajar en los pickings.</li></ul><p>3.2. Código Programa</p><p>Código en Anexo</p><h2 id="_11" tabindex="-1">11 <a class="header-anchor" href="#_11" aria-label="Permalink to &quot;11&quot;">​</a></h2><h4 id="_4-1-detalle-de-pasos-pdd-carga-materiales-a-ots-4" tabindex="-1">4.1. Detalle de Pasos- (PDD) Carga Materiales a OTs 4 <a class="header-anchor" href="#_4-1-detalle-de-pasos-pdd-carga-materiales-a-ots-4" aria-label="Permalink to &quot;4.1. Detalle de Pasos- (PDD) Carga Materiales a OTs 4&quot;">​</a></h4><p>El objetivo de este paso es optimizar la carga de materiales para las Ordenes de trabajo utilizando para ello los archivos Excel generados en el punto anterior completados con los datos obtenidos de la preparación física de los materiales realizadas por los operadores.</p><p>Los pasos principales son:</p><ul><li>El operario que ha realizado el picking escribe en el documento la información necesaria</li><li>Se ejecuta el programa GEjecuv4 que descontara los materiales reservados a las ordenes</li><li>Se verifica posibles errores para identificar problemas como reservas borradas, anuladas, etc.</li><li>Se corrigen errores tanto físicamente como en el sistema si fuera necesario.</li></ul><h4 id="_4-2-codigo-programa" tabindex="-1">4.2. Código Programa <a class="header-anchor" href="#_4-2-codigo-programa" aria-label="Permalink to &quot;4.2. Código Programa&quot;">​</a></h4><p>Se ha generado un ejecutable en Python que realizara:</p><ul><li><p>Lectura Información de Materiales preparados</p></li><li><p>Conexión SAP</p></li><li><p>Para cada material servido</p></li><li><p>Generar Documento Carga Material para cada Reserva, LineaReserva, Lote, ClaseValoración, Cantidad, Destino.</p></li><li><p>Confirmar Documento</p></li><li><p>Generar Orden de Transporte</p></li><li><p>Confirmar Orden de Transporte</p></li></ul><p>Generación Informe de Ejecución</p><h2 id="el-codigo-esta-disponible-en-el-anexo" tabindex="-1">El código está disponible en el Anexo <a class="header-anchor" href="#el-codigo-esta-disponible-en-el-anexo" aria-label="Permalink to &quot;El código está disponible en el Anexo&quot;">​</a></h2><h2 id="recursos-auxiliares-utilizados" tabindex="-1">Recursos Auxiliares Utilizados <a class="header-anchor" href="#recursos-auxiliares-utilizados" aria-label="Permalink to &quot;Recursos Auxiliares Utilizados&quot;">​</a></h2><table><thead><tr><th>Recursos Utilizados</th><th>A</th></tr></thead><tbody><tr><td>Recursos externos usados</td><td></td></tr><tr><td>(1) SAP Automation en &#39;Medium&#39;.</td><td></td></tr><tr><td>(2) Documentación blog oficial SAP sobre scripting.</td><td></td></tr><tr><td>(3) Documentación SAP de referencia &#39;como usar SAP gui con Python&#39;.</td><td></td></tr><tr><td>(4) Paquete Anaconda.</td><td></td></tr><tr><td>(5) Lenguage Python.</td><td></td></tr><tr><td>(6) Código fuente solución implantada.</td><td></td></tr><tr><td>(7) Articulo en Medium REPSOL sobre RPA.</td><td></td></tr><tr><td>(8) Introducción a Microsoft Power Automate.</td><td></td></tr><tr><td>(9) Analisis Herramientas RPA comerciales.</td><td></td></tr><tr><td>(10) Scripting Tracker</td><td></td></tr></tbody></table><hr><p>B.1. Código Programas generados para resolver el problema</p><table><thead><tr><th>Códigos Fuente</th><th>Nota</th></tr></thead><tbody><tr><td>B</td><td>- Con el objetivo de limitar el tamaño del informe no se anexan el código utilizado en la realización del proyecto. - El código generado tiene una longitud de 60 páginas. - Si estuviera interesado ponerse en contacto con Angel A. Urbina del equipo de Almacén</td></tr></tbody></table>`,194),s=[t];function n(d,l,c,p,u,m){return o(),a("div",null,s)}const g=e(i,[["render",n]]);export{b as __pageData,g as default};
